import {
  BrowserRouter,
  Route,
  Switch,
  Link,
  Redirect,
  useParams,
  useRouteMatch,
  useHistory
} from "react-router-dom";

import "./styles.css";

const Page0 = () => <h1>Page 0</h1>;
const Page1 = () => <h1>Page 1</h1>;

const Page2Nested1 = () => <h1>Page 2 Nested 1</h1>;
const Page2Nested2 = () => {
  const { id } = useParams();
  return <h1>Page 2 Nested 2 - {id}</h1>;
};
const Page2 = () => {
  const match = useRouteMatch();
  console.log(match);
  return (
    <>
      <h1>Page 2</h1>

      <Link to={`${match.url}/p2n1`}>Page 1</Link>
      <Link to={`${match.url}/123123`}>Page 2</Link>

      <Switch>
        <Route path={`${match.url}/p2n1`} component={Page2Nested1} />
        <Route path={`${match.url}/:id`} component={Page2Nested2} />
      </Switch>
    </>
  );
};

export default function App() {
  return (
    <BrowserRouter>
      <Link to="/page1">Root</Link>
      <Link to="/page2">Page 1</Link>
      <Link to="/page3">Page 2</Link>

      <Switch>
        <Route exact path="/page1" component={Page0} />
        <Route path="/page2" component={Page1} />
        <Route path="/page3" component={Page2} />

        <Redirect to="/page1" />
      </Switch>
    </BrowserRouter>
  );
}
